package com.leo.leetcode.string;

import org.junit.Assert;
import org.junit.Test;

import static org.junit.Assert.*;

public class T657Test {

    @Test
    public void judgeCircle() {
        T657 t657 = new T657();
        Assert.assertTrue(
                t657.judgeCircle("UD")
        );
        Assert.assertFalse(
                t657.judgeCircle("LL")
        );
        Assert.assertTrue(
                t657.judgeCircle("")
        );
    }
}